import React from 'react'
import Navbar from "./Navbar"
import Header from "./Header"
import Particles from 'react-particles-js';
const Frontpage = () => {
    return (
        <>
            <Navbar />  
            <Header />  
           <Particles />
           prams={{
               particles:{
                   number:{
                       value:30,
                       density:{
                           enable:true,
                           value_area:900
                       }
                   }
               }
           }}
        </>
    )
}

export default Frontpage;
